import { Table } from "./table";
import { DateFilter } from "./date_filter";
import s from "../styles/content.module.scss";

export const Content = ({ tableData }) => {
  const icons = [
    {
      key: "type",
      icon: <ContentIcon />,
    },
    {
      key: "download",
      icon: <ContentIcon2 />,
      title: "Even rows of data",
      description: "Display rows 1,3,5 etc",
    }
  ]
  return (
    <div className={s.content}>
      <Sidebar />
      <div className="content">
        <div className="table__wrapper">
          <div className={s.content__title}>
            <h1 className={s.content__text}>Dashboard</h1>
            <div className="table__right-menu">
              <DateFilter />
              {/* icons */}

            </div>
          </div>
          <Table />
        </div>
      </div>
    </div>
  );
};
